    console.log("passed university props is ", props.universities)

    const [universities, setUniversities] = useState([]);

    useEffect(() => {
        const universities = props?.universities?.universityData?.universityList?.responseData;
        setUniversities(universities)
    }, [props])


    return <React.Fragment>
        {/* <div className="row"> */}
            {universities && arrayChunks(universities, 3).map((universityRow: any, index: any) => {

